<!DOCTYPE html>
<html lang="en">
<head>
	<script language="JavaScript">
	var howMany = 1;
	var page = new Array(howMany+1);

	page[0]="https://script.google.com/macros/s/AKfycbxy5bLqCtihv-8H4ZR3PyePjJOnURBNoADKo6lRwJjQ6kg1S7TC/exec";
	page[1]="https://script.google.com/macros/s/AKfycbxy5bLqCtihv-8H4ZR3PyePjJOnURBNoADKo6lRwJjQ6kg1S7TC/exec";

	function rndnumber(){
		var randscript = -1;
		while (randscript < 0 || randscript > howMany || isNaN(randscript)){
			randscript = parseInt(Math.random()*(howMany+1));
		}
		return randscript;
	}
	quo = rndnumber();
	quox = page[quo];
	window.location=(quox);
	</script>
